require

function Logs(){
    let logName = "2022-08-09-105303.log"
    let logDir = "../../logs/"

    const reader = new FileReader();
    const logFile = new File(["test"], logDir + logName)
    reader.readAsText(logFile)
    return(
        <div className="Logs">
            <p>Result {reader.result}</p>
        </div>
    );
}

export default Logs;
